import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useImages } from '../context/ImageContext';
import Navbar from '../components/common/Navbar';

const ImageUpload = () => {
  const [file, setFile] = useState(null);
  const [preview, setPreview] = useState(null);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const { uploadImage, loading } = useImages();
  const navigate = useNavigate();

  const handleFileChange = (e) => {
    const selectedFile = e.target.files[0];
    
    if (!selectedFile) {
      setFile(null);
      setPreview(null);
      return;
    }
    
    // Check if file is an image
    if (!selectedFile.type.startsWith('image/')) {
      setError('Please select an image file');
      setFile(null);
      setPreview(null);
      return;
    }
    
    setFile(selectedFile);
    setError('');
    
    // Create preview
    const reader = new FileReader();
    reader.onloadend = () => {
      setPreview(reader.result);
    };
    reader.readAsDataURL(selectedFile);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    if (!file) {
      setError('Please select an image to upload');
      return;
    }
    
    try {
      const result = await uploadImage(file);
      setSuccess('Image uploaded successfully!');
      setFile(null);
      setPreview(null);
      
      // Navigate to dashboard after a short delay
      setTimeout(() => {
        navigate('/dashboard');
      }, 2000);
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to upload image');
    }
  };

  return (
    <div>
      <Navbar />
      
      <div className="container">
        <div className="card">
          <h2>Upload Image</h2>
          <p>Upload an image to verify its authenticity and store it securely.</p>
          
          {error && (
            <div className="alert alert-danger">{error}</div>
          )}
          
          {success && (
            <div className="alert alert-success">{success}</div>
          )}
          
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label htmlFor="image">Select Image</label>
              <input
                type="file"
                id="image"
                className="form-control"
                accept="image/*"
                onChange={handleFileChange}
                disabled={loading}
              />
            </div>
            
            {preview && (
              <div style={{ marginTop: '20px', marginBottom: '20px' }}>
                <h3>Preview</h3>
                <img 
                  src={preview} 
                  alt="Preview" 
                  style={{ 
                    maxWidth: '100%', 
                    maxHeight: '300px', 
                    display: 'block',
                    margin: '0 auto',
                    borderRadius: '8px'
                  }} 
                />
              </div>
            )}
            
            <button 
              type="submit" 
              className="btn" 
              disabled={!file || loading}
            >
              {loading ? 'Uploading...' : 'Upload Image'}
            </button>
          </form>
        </div>
        
        <div className="card" style={{ marginTop: '20px' }}>
          <h3>What happens when you upload?</h3>
          <ul>
            <li>Your image is analyzed for deepfake detection</li>
            <li>A unique SHA256 hash is generated for your image</li>
            <li>ORB features are extracted for similarity comparison</li>
            <li>The image is stored on IPFS for decentralized storage</li>
            <li>A record is created on the blockchain for verification</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default ImageUpload;
